Mitosis - Anaphase

Mitosis is the process of cell replication or cell division. ¬†

During anaphase, each pair of chromosomes also known as sister chromatids (highlighted in pink) is separated into two identical, independent chromosomes. The chromosomes are separated and pulled to opposite ends of the cell by the mitotic spindle - a structure made from long proteins called microtubules (highlighted in blue). Anaphase ensures that each daughter cell receives an identical set of chromosomes, and it is followed by the fifth and final phase of mitosis, known as telophase.

